import { Doughnut } from "react-chartjs-2";
import { MDBContainer } from "mdbreact";
import axios from 'axios';
// Doughnut Chart
const dataDoughnut = {
    labels: ["Red", "Green", "Yellow", "Grey", "Dark Grey"],
    datasets: [
      {
        data: [300, 50, 100, 40, 120],
        backgroundColor: ["#F7464A", "#46BFBD", "#FDB45C", "#949FB1", "#4D5360"],
        hoverBackgroundColor: [
          "#FF5A5E",
          "#5AD3D1",
          "#FFC870",
          "#A8B3C5",
          "#616774"
        ]
      }
    ]
  };
class FirstPage extends React.Component {
    componentDidMount() {
        const config = {
            headers: {'Access-Control-Allow-Origin': '*'}
        };
        axios.get('http://pfm.myoxygen.ir/auth/realms/master/protocol/openid-connect/auth?response_type=code&state=&client_id=79eaa7d7-83a8-42d3-9b95-94b53964&client_secret=4afab5ab-0bf1-430f-8839-0b372d80c781&scope=&redirect_uri=http://192.168.1.184:3000', config)
          .then(res => {
            const persons = res.data;
            console.log(persons);
          })
      }

    render() {
        return (
            <MDBContainer>
                <div className="row">
                <div className="col-sm">
              <h3 className="mt-3">Doughnut Chart</h3>
              <Doughnut data={dataDoughnut} options={{ responsive: true }} />
            </div>
                </div>
